import React from "react";
import logo from "../assets/logo.png";

function AuthLayOut({ childern }) {
  return (
    <>
      <div>
        <img src={logo} alt="logo" height={60} width={180}></img>
      </div>
      {childern}
    </>
  );
}

export default AuthLayOut;
